"""2.2 Konversi Bilangan
Buatlah code menu untuk konversi bilangan dari Desimal ke Biner dan sebaliknya, yaitu :
<br>• pilihan 1: Desimal ke Biner (input Desimal, output Biner)
<br>• pilihan 2: Biner ke Desimal (input Biner, output Desimal)
<br>• menu lagi, apakah user akan mengulangi operasi ataukah berhenti
Contoh output dapat dilihat pada Gambar 2.
<br>
![image.png](data:image/png;base64,)
<br>
gambar b <br>
![image.png](data:image/png;base64,)
"""

stop=False
while not(stop):
    print('Menu')
    print('Tekan 1 untuk konversi desimal ke Biner')
    print('Teksn 2 untuk konversi Biner ke desimal')
    inp=int(input('masukkan pilihan anda ='))
    if inp==1:
        bilangan=int(input("masukkan Desimal= "))
        hasildiv=bilangan
        strbinner=" "
        while hasildiv != 0:
            hasilmod=hasildiv%2
            hasildiv=hasildiv//2
            strbinner=str(hasilmod)+strbinner
        print('Bilangan Biner =',strbinner)
        masuk=input('ingin mengulang operasi kembali(y/t)?')
        print(40*'=')
        if masuk=='y':
            stop=False
        else:
            stop=True
    if inp==2:
        biner=input('masukkan biner=')
        b=0
        pangkat=0
        for i in range(len(biner)-1,-1,-1):
            b=b+int(biner[i])*2**pangkat
            pangkat+=1
        print('Bilangan Desimal=',b)
        masuk=input('ingin mengulang operasi kembali(y/t)?')
        print(40*'=')
        if masuk=='y':
            stop=False
        else:
            stop=True

